import React, { Component } from "react";

class ShowTime extends Component {
  showtime() {
    // setTimeout("this.showtime", 500);
  }
  render() {
    let dt = new Date();
    var datetime = dt.toLocaleTimeString();
    return (
      <center>
        <i id="datetime" class="gbold">
          {this.datetime};
        </i>
      </center>
    );
  }
}

export default ShowTime;
